import React from "react";
import {useAuth0} from "@auth0/auth0-react";


const Profile = () => {
    const { user, isAuthenticated, isLoading } = useAuth0();

    if (isLoading) {
        return <div></div>;
    }

    return (
        isAuthenticated && (
            <div>
                <img src={user.picture} alt={user.name} />
                <h2>{user.name}</h2>
                <p>{user.email}</p>
                <p>{user.id}</p>
                <p>{user.logins_count}</p>

            </div>
        )
    );
};

export default Profile
